const axios = require('axios');

try {
  const response = await axios.axiosGet('APIUrl', {
    headers: {
      Authorization: 'Client-ID v2St8noHReHIJYrKEp25B9DhyBDbDYY4OHQzt14RYxk',
    },
    params: {
      query: 'queryToFind',
    }
  });
  console.log(response);
} catch (error) {
  console.error(error);
}

export default async function github(queryAsInterpolatedString) {
  const repos = await axios.post('/repos', {}, {

    params: {
      query: queryAsInterpolatedString,
    }
  });  

  console.log('repos =', repos);
  return repos;
}
